   public static void SuccessEnchant(L1PcInstance pc, L1ItemInstance item, GameClient client, int i) {
     boolean equipcheck = false;
     String s = "";
     String sa = "";
     String sb = "";
     String s1 = item.getName();
     String pm = "";
     int msgnum = 161;

     if (item.isEquipped()) {
       pc.getInventory().setEquipped(item, false);
       equipcheck = true;
     }

     if (item.getEnchantLevel() > 0) {
       pm = "+";
     }
     if (item.getItem().getType2() == 1) {
       if (!item.isIdentified() || item.getEnchantLevel() == 0) {
         switch (i) {
           case -1:
             s = s1;
             sa = "$246";
             sb = "$247";
             break;

           case 1:
             s = s1;
             sa = "$245";
             sb = "$247";
             break;

           case 2:
             s = s1;
             sa = "$245";
             sb = "$248";
             break;

           case 3:
             s = s1;
             sa = "$245";
             sb = "$248";
             break;
         }
       } else {
         switch (i) {
           case -1:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$246";
             sb = "$247";
             break;

           case 1:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$245";
             sb = "$247";
             break;

           case 2:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$245";
             sb = "$248";
             break;

           case 3:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$245";
             sb = "$248";
             break;
         }
       }
     } else if (item.getItem().getType2() == 2) {
       if (!item.isIdentified() || item.getEnchantLevel() == 0) {
         switch (i) {
           case -1:
             s = s1;
             sa = "$246";
             sb = "$247";
             break;
           case 0:
             msgnum = 4056;
             s = s1;
             sa = "$246";
             sb = "$247";
             break;
           case 1:
             s = s1;
             sa = "$252";
             sb = "$247 ";
             break;

           case 2:
             s = s1;
             sa = "$252";
             sb = "$248 ";
             break;

           case 3:
             s = s1;
             sa = "$252";
             sb = "$248 ";
             break;
         }
       } else {
         switch (i) {
           case -1:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$246";
             sb = "$247";
             break;

           case 1:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$252";
             sb = "$247 ";
             break;

           case 2:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$252";
             sb = "$248 ";
             break;

           case 3:
             s = pm + item.getEnchantLevel() + " " + s1;

             sa = "$252";
             sb = "$248 ";
             break;
         }
       }
     }
     pc.sendPackets((ServerBasePacket)new S_ServerMessage(msgnum, s, sa, sb));
     int oldEnchantLvl = item.getEnchantLevel();
     int newEnchantLvl = item.getEnchantLevel() + i;

     if (oldEnchantLvl <= newEnchantLvl) {
       EnchantResultTable.getIns().send(pc, SC_ENCHANT_RESULT.eResult.SUCCESS, newEnchantLvl - oldEnchantLvl, item);
     }
     else if (newEnchantLvl > 0) {
       EnchantResultTable.getIns().send(pc, SC_ENCHANT_RESULT.eResult.SUCCESS, -oldEnchantLvl - newEnchantLvl, item);
     } else {

       EnchantResultTable.getIns().send(pc, SC_ENCHANT_RESULT.eResult.SUCCESS, -oldEnchantLvl - -newEnchantLvl, item);
     }


     int safe_enchant = item.getItem().get_safeenchant();
     item.setEnchantLevel(newEnchantLvl);
     client.getActiveChar().getInventory().updateItem(item, 4);
     pc.saveInventory();
     if (newEnchantLvl > safe_enchant) {
       client.getActiveChar().getInventory().saveItem(item, 4);
       pc.saveInventory();

       LoggerInstance.getInstance().addEnchant(pc, item, true);
     }

     if (ItemMessageTable.getInstance().isEnchantMessage(item.getItemId())) {
       L1ItemMessage temp = ItemMessageTable.getInstance().getEnchantMessage(item.getItemId());
       if (temp != null &&
         temp.getType() == 2 && newEnchantLvl >= temp.getOption() &&
         temp.isMentuse()) {
         broadcastEnchantMessage(item.getItem(), oldEnchantLvl, (item.get_Carving() == 1));

       }

     }
     else if (Config.ServerEnchant.MasterEnchantMess && item.getItem().getType2() == 1 && newEnchantLvl >= Config.ServerEnchant.Enchant_Count_Weapon) {

       broadcastEnchantMessage(item.getItem(), oldEnchantLvl, (item.get_Carving() == 1));
     }
     else if (Config.ServerEnchant.MasterEnchantMess && item.getItem().getType2() == 2 && newEnchantLvl >= Config.ServerEnchant.Enchant_Count_Armor) {

       broadcastEnchantMessage(item.getItem(), oldEnchantLvl, (item.get_Carving() == 1));
     }
     else if (Config.ServerEnchant.MasterEnchantMess && item.getItem().getType2() == 2 && (item
       .getItem().getType() == 8 || item.getItem().getType() == 9 || item.getItem().getType() == 10 || item
       .getItem().getType() == 11 || item.getItem().getType() == 12 || item
       .getItem().getType() == 28 || item.getItem().getType() == 30) && newEnchantLvl >= Config.ServerEnchant.Enchant_Count_Accessory) {

       if (oldEnchantLvl < newEnchantLvl) {
         broadcastEnchantMessage(item.getItem(), oldEnchantLvl, (item.get_Carving() == 1));
       }
     }
     if (item.getItem().getType2() != 1 || Config.LogStatus.LoggingWeaponEnchant == 0 ||
       safe_enchant == 0 || newEnchantLvl >= Config.LogStatus.LoggingWeaponEnchant);


     if (item.getItem().getType2() != 2 || Config.LogStatus.LoggingArmorEnchant == 0 ||
       safe_enchant == 0 || newEnchantLvl >= Config.LogStatus.LoggingArmorEnchant);



     if (equipcheck) {
       pc.getInventory().setEquipped(item, true);
       equipcheck = false;
     }
     pc.sendPackets((ServerBasePacket)new S_SPMR(pc));
     pc.sendPackets((ServerBasePacket)new S_OwnCharStatus(pc));
   }

   public static void broadcastEnchantMessage(L1Item item, int enchantLevel, boolean carving) {
     String message = carving ? MJString.concat(new String[] { item.getNameId(), "$28473" }) : item.getNameId();
     if (item.getType2() == 2) {
       L1World.getInstance()
         .broadcastPacketToAll((ServerBasePacket)S_EnchantMessage.newSilverMessage(enchantLevel, item.getGfxId(), message));
     } else {
       L1World.getInstance()
         .broadcastPacketToAll((ServerBasePacket)S_EnchantMessage.newBlueMessage(enchantLevel, item.getGfxId(), message));
     }
   }



   public static void FailureEnchant(L1PcInstance pc, L1ItemInstance item, GameClient client) {
     int itemType = item.getItem().getType2();
     int itemId = item.getItem().getItemId();

     if (itemId >= 1115 && itemId <= 1118) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(1310));
       pc.getInventory().setEquipped(item, false);
       item.setEnchantLevel(0);
       pc.getInventory().updateItem(item, 4);
       pc.saveInventory();
       if (itemType != 1 &&
         itemType == 2);
     } else {

       EnchantResultTable.getIns().send(pc, SC_ENCHANT_RESULT.eResult.FAIL_DESTROY, 0, item);


       pc.getInventory().removeItem(item, item.getCount());

       LoggerInstance.getInstance().addEnchant(pc, item, false);
       TJCouponProvider.provider().onLostItem(pc, item);
     }
     pc.sendPackets((ServerBasePacket)new S_OwnCharStatus(pc));
   }

