   public static boolean usePolyScroll(L1PcInstance pc, int item_id, String s) {
     int time = 0;
     boolean ring = false;
     boolean ring2 = false;
     switch (item_id) {
       case 4100500:
       case 4100610:
         time = 3600;
         break;

       case 40088:
       case 40096:
         time = 3600;
         break;
       case 140088:
         time = 2100;
         break;
       case 210112:
         time = 3600;
         break;
       case 40008:
         time = 7200;
         break;
       case 140008:
         time = 7200;
         break;
       default:
         return false;
     }
     boolean maple = false;
     if (s.startsWith("maple")) {
       maple = true;
       if (!pc.isPolyRingMaster() && !pc.isPolyRingMaster2())
         return false;
     }
     if (s.startsWith("maple")) {
       String aa = s;
       String bb = aa.replace("maple ", "");
       s = bb;
     }
     if (s.endsWith(" 100")) {
       String aa = s;
       String bb = aa.replace(" 100", "");
       s = bb;
     }
     if (s.equalsIgnoreCase("ranking class polymorph")) {
       s = "rangking " + L1PolyMorph.getReplacePolyName(pc.getType()) + ((pc.get_sex() == 0) ? " male" : " female");
     }

     if (s.startsWith("rangking") &&
       !MJRankUserLoader.getInstance().isRankPoly(pc)) {
       return false;
     }


     L1PolyMorph poly = PolyTable.getInstance().getTemplate(s);




     if (poly != null || s.equals("")) {
       if (s.equals("")) {
         int spriteId = pc.getCurrentSpriteId();
         if (spriteId == 6034 || spriteId == 6035) {
           return true;
         }
         if (pc.hasSkillEffect(80012)) {
           pc.removeSkillEffect(80012);
         } else if (pc.hasSkillEffect(80013)) {
           pc.removeSkillEffect(80013);
         } else {
           pc.removeSkillEffect(67);
         }
         return true;
       }
       if (Config.ServerAdSetting.PolyEvent2) {
         int minlevel = 0;
         int downlevel = Config.ServerAdSetting.PolyEvent2_level_down;
         minlevel = poly.getMinLevel() - downlevel;

         if (minlevel <= pc.getLevel()) {
           if (item_id == 40008 || item_id == 140008 || item_id == 40410) {
             if (pc.isPolyRingMaster2()) {
               ring = false;
               ring2 = true;
             } else if (pc.isPolyRingMaster()) {
               ring = true;
               ring2 = false;
             }
           }
           if (ring && ring2) {
             ring = false;
             ring2 = true;
           }

           L1PolyMorph.doPoly((L1Character)pc, poly.getPolyId(), time, 1, ring, ring2);
           return true;

         }

       }
       else {

         if (poly.getMinLevel() <= pc.getLevel() || pc.isGm()) {
           if (pc.isPolyRingMaster2() && maple) {
             ring = false;
             ring2 = true;
           } else if (pc.isPolyRingMaster() && maple) {
             ring = true;
             ring2 = false;
           }
           if (ring && ring2) {
             ring = false;
             ring2 = true;
           }


           L1PolyMorph.doPoly((L1Character)pc, poly.getPolyId(), time, 1, ring, ring2);
           return true;
         }
         return false;
       }
     }
     return false;
   }

