   private void polyAction(L1PcInstance attacker, L1Character cha, int itemId, String s) {
     boolean isSameClan = false;

     if (cha instanceof L1PcInstance) {
       L1PcInstance pc = (L1PcInstance)cha;
       if (pc.getClanid() != 0 && attacker.getClanid() == pc.getClanid()) {
         isSameClan = true;
       }

       if (attacker.getId() != pc.getId() && (pc.hasSkillEffect(80012) || pc
         .hasSkillEffect(80013))) {

         pc.sendPackets((ServerBasePacket)new S_SkillSound(pc.getId(), 15846));
         pc.broadcastPacket((ServerBasePacket)new S_SkillSound(pc.getId(), 15846));
         attacker.sendPackets((ServerBasePacket)new S_ServerMessage(280));
         return;
       }
     }
     if (cha instanceof L1MonsterInstance) {
       return;
     }
     if (attacker.getId() != cha.getId() && !isSameClan) {
       int probability = 3 * (attacker.getLevel() - cha.getLevel()) - cha.getResistance().getEffectedMrBySkill();
       int rnd = _random.nextInt(100) + 1;
       if (rnd > probability) {
         attacker.sendPackets((ServerBasePacket)new S_ServerMessage(280));

         return;
       }
     }
     int[] polyArray = { 15552, 979, 1037, 1039, 15715, 3861, 3862, 3864, 3865, 3866, 3871, 15600, 15739, 15740, 16145, 14094, 15553, 15743, 3881, 3882, 3883, 3884, 3885, 15719, 15554, 15575, 30, 2376, 2377, 2378, 11358, 11396, 11397, 12225, 11399, 11398 };



     int pid = _random.nextInt(polyArray.length);
     int polyId = polyArray[pid];
     if (cha instanceof L1PcInstance) {
       L1PcInstance pc = (L1PcInstance)cha;
       if (pc.getInventory().checkEquipped(20281) || (!pc._PolyMasterCheck && (pc
         .isPolyRingMaster() || pc.isPolyRingMaster2()))) {
         if (!usePolyScroll(pc, itemId, s))
         {
           pc.sendPackets((ServerBasePacket)new S_ServerMessage(181));
         }
       } else {
         L1Skills skillTemp = SkillsTable.getInstance().getTemplate(67);
         L1PolyMorph.doPoly((L1Character)pc, polyId, skillTemp.getBuffDuration(), 1, false, false);

         if (attacker.getId() != pc.getId()) {
           pc.sendPackets((ServerBasePacket)new S_ServerMessage(241, attacker.getName()));
         }
       }
     } else if (cha instanceof L1MonsterInstance) {
       L1MonsterInstance mob = (L1MonsterInstance)cha;
       if (mob.getLevel() < 50) {
         int npcId = mob.getNpcTemplate().get_npcId();
         if (npcId != 45338 && npcId != 45370 && npcId != 45456 && npcId != 45464 && npcId != 45473 && npcId != 45488 && npcId != 45497 && npcId != 45516 && npcId != 45529 && npcId != 45458) {

           L1Skills skillTemp = SkillsTable.getInstance().getTemplate(67);
           L1PolyMorph.doPoly((L1Character)mob, polyId, skillTemp.getBuffDuration(), 1, false, false);
         }
       }
     }
   }


