   private boolean withdrawPet(L1PcInstance pc, int itemObjectId) {
     if (!pc.getMap().isTakePets()) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(563));
       return false;
     }

     if (pc.getMapId() == 781 || pc.getMapId() == 782) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(563));
       return false;
     }

     if (pc.isInWarArea()) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(563));
       return false;
     }

     int petCost = 0;
     Object[] petList = pc.getPetList().values().toArray();
     for (Object pet : petList) {
       if (pet instanceof L1PetInstance && (
         (L1PetInstance)pet).getItemObjId() == itemObjectId) {
         return false;
       }


       if (pet instanceof L1PetInstance) {
         petCost += ((L1NpcInstance)pet).getPetcost();
       }
     }
     int charisma = pc.getAbility().getTotalCha();
     if (pc.isCrown()) {
       charisma += 6;
     } else if (pc.isElf()) {
       charisma += 12;
     } else if (pc.isWizard()) {
       charisma += 6;
     } else if (pc.isDarkelf()) {
       charisma += 6;
     } else if (pc.isDragonknight()) {
       charisma += 6;
     } else if (pc.isBlackwizard()) {
       charisma += 6;
     }

     charisma -= petCost;
     int petCount = charisma / 6;
     if (petCount <= 0) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(489));
       return false;
     }

     L1Pet l1pet = PetTable.getInstance().getTemplate(itemObjectId);
     if (l1pet != null) {
       L1Npc npcTemp = NpcTable.getInstance().getTemplate(l1pet.get_npcid());
       L1PetInstance pet = new L1PetInstance(npcTemp, pc, l1pet);
       pet.setPetcost(6);
     }
     return true;
   }

   private void useResolvent(L1PcInstance pc, L1ItemInstance item, L1ItemInstance resolvent) {
     if (item == null || resolvent == null) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(79));
       return;
     }
     if (item.getItem().getType2() == 1 || item.getItem().getType2() == 2) {

       if (item.getEnchantLevel() != 0) {
         pc.sendPackets((ServerBasePacket)new S_ServerMessage(1161));
         return;
       }
       if (item.isEquipped()) {
         pc.sendPackets((ServerBasePacket)new S_ServerMessage(1161));
         return;
       }
       if (item.getBless() >= 128) {
         pc.sendPackets((ServerBasePacket)new S_ServerMessage(1161));
         return;
       }
     }
     int crystalCount = ResolventTable.getInstance().getCrystalCount(item.getItem().getItemId());
     if (crystalCount == 0) {
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(1161));

       return;
     }
     int rnd = _random.nextInt(100) + 1;
     if (rnd >= 1 && rnd <= 20) {
       crystalCount = 0;
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(158, item.getName()));


     }
     else if (rnd >= 21 && rnd <= 90) {
       crystalCount *= 1;
     } else if (rnd >= 91 && rnd <= 100) {
       crystalCount = (int)(crystalCount * 1.5D);
       pc.getInventory().storeItem(41246, (int)(crystalCount * 1.5D));
     }
     if (crystalCount != 0) {
       L1ItemInstance crystal = ItemTable.getInstance().createItem(41246);
       crystal.setCount(crystalCount);
       if (pc.getInventory().checkAddItem(crystal, 1) == 0) {
         pc.getInventory().storeItem(crystal);
         pc.sendPackets((ServerBasePacket)new S_ServerMessage(403, crystal.getLogName()));
       } else {
         L1World.getInstance().getInventory(pc.getX(), pc.getY(), pc.getMapId()).storeItem(crystal);
       }
     }
     pc.getInventory().removeItem(item, 1);
     pc.getInventory().removeItem(resolvent, 1);
   }

