   private String byteWrite(long value) {
     long temp = value / 128L;
     StringBuffer sb = new StringBuffer();
     if (temp > 0L) {
       sb.append((byte)hextable[(int)value % 128]);
       while (temp >= 128L) {
         sb.append((byte)hextable[(int)temp % 128]);
         temp /= 128L;
       }
       if (temp > 0L) {
         sb.append((int)temp);
       }
     } else if (value == 0L) {
       sb.append(0);
     } else {
       sb.append((byte)hextable[(int)value]);
       sb.append(0);
     }

     return sb.toString();
   }

   private void 탐열매(L1PcInstance pc, int _objid, L1ItemInstance item, int day) {
     try {
       Timestamp tamtime = null;
       long time = 0L;
       long sysTime = System.currentTimeMillis();
       String _Name = null;
       int tamcount = pc.tamcount();

       Connection con = null;
       PreparedStatement pstm = null;
       ResultSet rs = null;
       try {
         con = L1DatabaseFactory.getInstance().getConnection();
         pstm = con.prepareStatement("SELECT TamEndTime, char_name FROM characters WHERE objid=?");
         pstm.setInt(1, _objid);
         rs = pstm.executeQuery();
         while (rs.next()) {
           _Name = rs.getString("char_name");
           tamtime = rs.getTimestamp("TamEndTime");
           if (tamtime != null &&
             sysTime < tamtime.getTime()) {
             time = tamtime.getTime() - sysTime;
           }
         }

       } catch (SQLException e) {
         e.printStackTrace();
       } finally {
         SQLUtil.close(rs);
         SQLUtil.close(pstm);
         SQLUtil.close(con);
       }

         if (time != 0L) {
            // 添加預訂項目
             tamadd(_Name, _objid, day, byteWrite(_objid));

            // 向玩家發送Tam窗口信息
             pc.sendPackets((ServerBasePacket) new S_TamWindow(pc.getAccountName()));

            // 向玩家發送系統消息，通知商品已預訂
             pc.sendPackets((ServerBasePacket) new S_SystemMessage("[" + _Name + "] 已有正在使用的商品，因此已預訂。"), true);

            // 從玩家的物品欄中移除一個指定的物品
             pc.getInventory().removeItem(item, 1);

            // 結束方法
             return;
         }
       if (tamcount >= 5) {
         pc.sendPackets((ServerBasePacket)new S_ServerMessage(3904));
         return;
       }
       if (tamcount + 1 >= 1) {
         CharacterFreeShieldTable.getInstance().getTam(pc, tamcount + 1);
       }

       Timestamp deleteTime = null;
       deleteTime = new Timestamp(sysTime + 86400000L * day + 10000L);


       if (pc.getId() == _objid) {
         pc.setTamTime(deleteTime);
         try {
           pc.save();
         } catch (Exception e) {

           e.printStackTrace();
         }
       } else {
         tamupdate(_objid, deleteTime);
       }

       pc.sendPackets((ServerBasePacket)new S_TamWindow(pc.getAccountName()));
       if (pc.hasSkillEffect(7791)) {
         pc.removeSkillEffect(7791);
       } else if (pc.hasSkillEffect(7792)) {
         pc.removeSkillEffect(7792);
       } else if (pc.hasSkillEffect(7793)) {
         pc.removeSkillEffect(7793);
       } else if (pc.hasSkillEffect(7794)) {
         pc.removeSkillEffect(7794);
       } else if (pc.hasSkillEffect(7795)) {
         pc.removeSkillEffect(7795);
       } else {
         L1SkillId.recycleTam(pc);
       }
       pc.sendPackets((ServerBasePacket)new S_ServerMessage(3916));
       pc.sendPackets((ServerBasePacket)new S_SkillSound(pc.getId(), 2028), true);
       Broadcaster.broadcastPacket((L1Character)pc, (ServerBasePacket)new S_SkillSound(pc.getId(), 2028), true);
       pc.getInventory().removeItem(item, 1);
     }
     catch (Exception e) {
       e.printStackTrace();
     }
   }




