    public static void use_einhasad_potion(L1PcInstance pc, L1ItemInstance use_item, int charge_point) {
        // 檢查玩家是否具有技能效果 22018
        if (pc.hasSkillEffect(22018)) {
        // 發送系統消息通知玩家無法使用該物品
            pc.sendPackets((ServerBasePacket) new S_ServerMessage(2146));
            return;
        }

        // 計算使用點數
        int usage_point = SC_REST_EXP_INFO_NOTI.EINHASAD_LIMIT - charge_point;

        // 檢查玩家的祝福值是否超過使用點數
        if (pc.getAccount().getBlessOfAin() > usage_point) {
        // 發送系統消息通知玩家祝福值低於指定百分比才能使用該物品
            pc.sendPackets(String.format("祝福指數必須低於 %d%% 才能使用。", new Object[] { Integer.valueOf(usage_point / SC_REST_EXP_INFO_NOTI.EINHASAD_UNIT) }));
            return;
        }

        // 增加玩家的祝福值
        pc.getAccount().addBlessOfAin(charge_point, pc);

        // 發送系統消息通知玩家祝福值增加
        pc.sendPackets((ServerBasePacket) new S_SystemMessage(
                String.format("Einhasad的祝福增加了 %d%%。", new Object[] { Integer.valueOf(charge_point / SC_REST_EXP_INFO_NOTI.EINHASAD_UNIT) })));

        // 發送效果
        pc.send_effect(198);

        // 從玩家的物品欄中移除一個使用的物品
        pc.getInventory().removeItem(use_item, 1);
    }

